import React, { useEffect } from 'react';
import NavBar from '../components/NavBar';
import Posts from '../components/Posts';
import Comments from '../components/Comments';

const Home = () => {
  useEffect()
  return (
    <div>
     <NavBar/>
     <Comments/>
     <Posts/>
    </div>
  );
};

export default Home;
